import React, { useEffect, useState } from "react";
import axios from "axios";
import { CgHomeAlt } from "react-icons/cg";
import { BiRun } from "react-icons/bi";
import { TbBrain } from "react-icons/tb";
import { CgBulb } from "react-icons/cg";
import { RiCommandLine } from "react-icons/ri";
import { CgHeart } from "react-icons/cg";
import { FaRecycle } from "react-icons/fa";
import { FaRegCircleUser } from "react-icons/fa6";
import { LuBookmark } from "react-icons/lu";
import { FaComments } from "react-icons/fa6";
import { useNavigate } from "react-router-dom";


function Sidebar() {
    const navigate = useNavigate();
    const [categories, setCategories] = useState({});

    useEffect(() => {
        axios.get("http://localhost:8080/api/categories")
        .then(response => {
            setCategories(response.data);
        })
        .catch(error => {
            console.error("There was an error fetching the categories!", error);
        })
    })

    return ( 
        <div className="sidebar">
            <div className="sidebarWrapper">
                <div className="sidebarMenu">
                    <h3 className="sidebarTitle">Dashboard</h3>
                    <ul className="sidebarList">
                        <li className="sidebarListItem" onClick={() => navigate("/")}>
                            <CgHomeAlt className="sidebarIcon" />
                            Home
                        </li>
                        <li className="sidebarListItem" onClick={() => navigate("/physical")}>
                            <BiRun className="sidebarIcon" />
                            Physical
                        </li>
                        <li className="sidebarListItem" onClick={() => navigate("/mental")}>
                            <TbBrain className="sidebarIcon" />
                            Mental
                        </li>
                        <li className="sidebarListItem" onClick={() => navigate("/spiritual")}>
                            <CgBulb className="sidebarIcon" />
                            Spiritual
                        </li>
                        <li className="sidebarListItem" onClick={() => navigate("/social")}>
                            <RiCommandLine className="sidebarIcon" />
                            Social
                        </li>
                        <li className="sidebarListItem" onClick={() => navigate("/emotional")}>
                            <CgHeart className="sidebarIcon" />
                            Emotional
                        </li>
                        <li className="sidebarListItem" onClick={() => navigate("/environmental")}>
                            <FaRecycle className="sidebarIcon" />
                            {categories.environmental || Environmental}
                        </li>
                    </ul>
                </div>
                <div className="sidebarMenu">
                    <h3 className="sidebarTitle">Quick</h3>
                    <ul className="sidebarList">
                        <li className="sidebarListItem" onClick={() => navigate("/users")}>
                            <FaRegCircleUser className="sidebarIcon" />
                            {categories.users || Users}
                        </li>
                        <li className="sidebarListItem" onClick={() => navigate("/reports")}>
                            <LuBookmark className="sidebarIcon" />
                            {categories.reports || Reports}
                        </li>
                        <li className="sidebarListItem" onClick={() => navigate("/community")}>
                            <FaComments className="sidebarIcon" />
                            {categories.community || Community}
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Sidebar;
